script: |
  super -f tsv -I q1433.sql | sort > q1433.out

vector: true

inputs:
  - name: q1433.sql
    data: |
      SELECT c3+c3, a1+68
      FROM t1, t3
      WHERE a3=b1
      AND a1 in (895,668,179,32,237,622,779,521);
  - name: t1
  - name: t3

outputs:
  - name: q1433.out
    data: |
      1294	736
      592	963
